state = {
    court: {},
    isEditFormDisplayed: false,
    reDirectToHome: false,

}
    componentDidMount() {
        axios.get(`/api/courts/${this.props.match.params.courtId}`)
            .then((res) => {
                this.setState({court: res.data})
            })
    }
    render() {
        return (
            <div>
